function parseNum(v){ return Number(v || 0); }

const completed = new Set(['completed','processing','done']); // valid revenue statuses

return items.map(it => {
  const r = it.json;
  const revenue = completed.has((r.status || '').toLowerCase()) ? parseNum(r.total) : 0;
  const conversions = revenue > 0 ? 1 : 0; // 1 conversion per completed order
  return { json: {
    date: r.date,
    source: 'woocommerce',
    ad_spend: 0,      // WooCommerce has no ad spend
    revenue: revenue,
    clicks: 0,        // WooCommerce has no clicks
    conversions: conversions
  }};
});

function round2(n){ return Number.isFinite(n)?Number(n.toFixed(2)):n; }

const byDate = {};
items.forEach(({json:r})=>{
  const d = r.date.slice(0,10);
  if(!byDate[d]) byDate[d] = { date:d, ad_spend:0, revenue:0, clicks:0, conversions:0 };
  byDate[d].ad_spend += Number(r.ad_spend)||0;
  byDate[d].revenue += Number(r.revenue)||0;
  byDate[d].clicks += Number(r.clicks)||0;
  byDate[d].conversions += Number(r.conversions)||0;
});

return Object.values(byDate).map(d=>{
  const roas = d.ad_spend>0 ? round2(d.revenue/d.ad_spend) : null;
  const conversion_rate = d.clicks>0 ? round2((d.conversions/d.clicks)*100) : null;
  return { json: {...d, roas, conversion_rate} };
});

// Build QuickChart-compatible chart data
const labels = items.map(item => item.json.date);
const revenue = items.map(item => item.json.revenue);
const roas = items.map(item => item.json.roas);

return [{
  json: {
    chartData: {
      type: 'bar',
      data: {
        labels,
        datasets: [
          {
            label: 'Revenue',
            data: revenue,
            borderColor: 'blue',
            fill: false
          },
          {
            label: 'ROAS',
            data: roas,
            borderColor: 'green',
            fill: false
          }
        ]
      }
    }
  }
}];

// Initialize totals
let total_ad_spend = 0;
let total_revenue = 0;
let total_clicks = 0;
let total_conversions = 0;
let total_orders = 0;

// Loop through all items (daily records)
items.forEach(item => {
  const data = item.json;

  // Google Ads
  if (data.ad_spend) total_ad_spend += parseFloat(data.ad_spend);
  if (data.revenue) total_revenue += parseFloat(data.revenue);
  if (data.clicks) total_clicks += parseInt(data.clicks);
  if (data.conversions) total_conversions += parseInt(data.conversions);

  // WooCommerce orders
  if (data.order_value) {
    total_revenue += parseFloat(data.order_value);
    total_orders += 1; // count each order
  }

  // Salesforce opportunities
  if (data.opportunity_value) total_revenue += parseFloat(data.opportunity_value);
});

// Calculate ROAS and Conversion Rate
const roas = total_ad_spend > 0 ? (total_revenue / total_ad_spend).toFixed(2) : 0;
const conversion_rate = total_clicks > 0 ? ((total_conversions / total_clicks) * 100).toFixed(2) : 0;

// Return a single item with all totals
return [{
  json: {
    total_ad_spend: total_ad_spend.toFixed(2),
    total_revenue: total_revenue.toFixed(2),
    total_clicks,
    total_conversions,
    total_orders,
    roas,
    conversion_rate
  }
}];

